  const cards = Object.values(roles.roles).map(role=>{
    return <AboutCard card = {role}/>
  })
	return (
		<Container fluid className="text-center">
			<Row>
				<Col>
					<h1>About Siya</h1>
				</Col>
			</Row>
			<Row>
				<p id="aboutme">Let's go</p>
			</Row>
			<Row className="d-flex flex-nowrap p-2"></Row>
		</Container>
	);
};

export default About;
